import React from 'react';
import { ImLinkedin } from 'react-icons/im';
import {IoLogoWhatsapp} from 'react-icons/io';
import { ContactInfoContainer } from './styles';

type Props = {};

const ContactInfo = (props: Props) => {
  return (
    <ContactInfoContainer>
      <div className='container'>
        <h2>Contato</h2>
        <div className='text-info'>
          <div className='subcontainer'>
            <div className='info'>
              <p><IoLogoWhatsapp size={25} /> 31 9 9969-0001</p>
              <p id="contact-email">contato@advocaciadocidadao.com</p> 
            </div>
            <div>
              <h3>Siga-nos</h3>
              <div><ImLinkedin /></div>
            </div>
          </div>
          <div className='subcontainer'>
          <iframe className='' title='Onde estamos' src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3750.299688328666!2d-44.20292874972582!3d-19.95389508652452!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0xa6c3bb2ac82173%3A0x12459f8009a828ce!2sR.%20Jos%C3%A9%20Augusto%20Borges%2C%20484%20-%20Angola%2C%20Betim%20-%20MG%2C%2032604-078!5e0!3m2!1spt-BR!2sbr!4v1648856259998!5m2!1spt-BR!2sbr" width="600" height="450" loading="lazy" style={"border: 0;"} referrerPolicy="no-referrer-when-downgrade"></iframe>
          </div>
        </div>
      </div>
    </ContactInfoContainer>
  )
};

export default ContactInfo;
